import React from 'react';
import logo from './images/logo.svg';
import './App.css';
import Login from './components/Login';
import Footer from './components/Footer';

function App() {
	const renderProperScreen = () => {
		let isLogged = false;
		if(isLogged){
			return <div>OK</div>;
		}else{
			return <Login />;
		}
	}
	return (
		<div className="App">
			<div class="logo__contain">
				<img src={logo} className="logo" />
				<span className="logo__text">onOne</span>
			</div>
			<div>
				{renderProperScreen()}
			</div>
			<Footer></Footer>
		</div>
		);
	}
export default App;
